 );

 const formulario = (
  <div className="login">
     <div className="login-imagen-container">
      </div>
      <div className="login-formulario-container">
    <form action="">
      <div className="mb-3">
        <label htmlFor="usuario"><strong>Usuario</strong></label>
        <input type="text" placeholder="Usuario" className="form-control rounded-0" />
      </div>
      <div className="mb-3">
        <label htmlFor="password"><strong>Contraseña</strong></label>
        <input type="password" placeholder="Ingresa contraseña" className="form-control rounded-0" />
      </div>
      <button className="btn btn-success">Iniciar sesión</button>
    </form>
    </div>
    </div>
 );
};

